import sys, math
W,H = 16000,9000
SP = 1.0/16000.0
SV = 1.0/1000.0
HD = 160

class N:
    def __init__(self,d,s):
        self.w = self.dec(d,s)
        self.c = 0
    def dec(self,b,s):
        w,v,cnt=[],0,0
        for c in b:
            v=v*85+(ord(c)-33); cnt+=1
            if cnt==5:
                for i in range(4):
                    x=(v>>(24-i*8))&0xFF
                    w.append((x-256 if x>127 else x)*s)
                v,cnt=0,0
        return w
    def gw(self,n):
        r=self.w[self.c:self.c+n]; self.c+=n
        return r
    def lin(self,x,i,o,r=False):
        w,b,out=self.gw(i*o),self.gw(o),[]
        for k in range(o):
            a=b[k]
            for j in range(i): a+=x[j]*w[k*i+j]
            out.append(max(0.0,a) if r else a)
        return out

class A(N):
    def f(self,s,t,e,c):
        self.c=0
        w1,b1,w2,b2=self.gw(416),self.gw(32),self.gw(512),self.gw(16)
        
        # Helper for Encoder
        def enc(inp):
            h=[0.0]*32
            for r in range(32):
                a=b1[r]
                for j in range(13): a+=inp[j]*w1[r*13+j]
                h[r]=max(0.0,a)
            z=[0.0]*16
            for r in range(16):
                a=b2[r]
                for j in range(32): a+=h[j]*w2[r*32+j]
                z[r]=a
            return z
            
        # Encode Enemies
        encs=[]
        for en in e: encs.append(enc(en))
        g=[max(x[i] for x in encs) for i in range(16)] if encs else [0.0]*16
        
        # Encode Teammate
        tm = enc(t)
        
        # Backbone Input: Self(14)+TM(16)+Ctx(16)+CP(6) = 52
        x=s+tm+g+c
        x=self.lin(x,52,HD,True)
        x=self.lin(x,HD,HD,True)
        th=self.lin(x,HD,1)[0]
        an=self.lin(x,HD,1)[0]
        sh=self.lin(x,HD,2)
        bo=self.lin(x,HD,2)
        th=1.0/(1.0+math.exp(-th))
        an=(math.exp(2*an)-1)/(math.exp(2*an)+1)
        return [th,an,1 if sh[1]>sh[0] else 0,1 if bo[1]>bo[0] else 0]

